package com.rongke.model;import com.alibaba.fastjson.annotation.JSONField;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;import java.util.Date;/** * 跟踪信息 */@TableName("track_log")public class TrackLog implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * 操作人	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long adminId;	/**	 * 申请单ID	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long evaluationId;	/**	 * 标题	 */	private String title;	/**	 * 详情	 */	private String details;	/**	 * 	备忘录	 */	private Integer memo;	/**	 * 	操作对象 1 审核单 2 订单	 */	private Integer type;	/**	 * 审核单状态	 */	private String eStatus;	/**	 * 订单状态	 */	private String oStatus;	/**	 * 创建时间	 */	@JSONField(format="yyyy-MM-dd HH:mm:ss")	private Date createTime;	/**	 * 修改时间	 */	@JSONField(format="yyyy-MM-dd HH:mm:ss")	private Date updateTime;	/**	 * 状态	 */	private Integer status;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Long getAdminId() {		return adminId;	}	public void setAdminId(Long adminId) {		this.adminId = adminId;	}	public Long getEvaluationId() {		return evaluationId;	}	public void setEvaluationId(Long evaluationId) {		this.evaluationId = evaluationId;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getDetails() {		return details;	}	public void setDetails(String details) {		this.details = details;	}	public Integer getMemo() {		return memo;	}	public void setMemo(Integer memo) {		this.memo = memo;	}	public Integer getType() {		return type;	}	public void setType(Integer type) {		this.type = type;	}	public String geteStatus() {		return eStatus;	}	public void seteStatus(String eStatus) {		this.eStatus = eStatus;	}	public String getoStatus() {		return oStatus;	}	public void setoStatus(String oStatus) {		this.oStatus = oStatus;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Date getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Date updateTime) {		this.updateTime = updateTime;	}	public Integer getStatus() {		return status;	}	public void setStatus(Integer status) {		this.status = status;	}}